import Styled from 'styled-components';
const NewsTicker = () => {
  return (
    <Wrapper>
    <BreakingBox>
    <BigHeader className="heading"> Breaking News</BigHeader>
      </BreakingBox>
    <NewsBox>
  <News className="textUpdate"> Some shit about digital literacy</News>
    </NewsBox>
    </Wrapper>

  )
}
