background:white;
height:10vh;
width:80vw;
border-bottom: 1.5px solid #27184f;

`;

const BigHeader = Styled.h1`
font-size: 95%;
color:#f56468;
text-align: center;
`;

const News = Styled.p`
font-size: 1.5vw;
color:#27184f;
position:center;
text-align: right;
`;
export default NewsTicker
